const Footer = () => {  
    return (
    <footer className="footer bg-dark fixed-bottom">
        <a href="https://github.com/amnasyeda"><img src="./css/github.jpeg" alt="Github" className="icon"/></a>
        <a href="https://ca.linkedin.com/in/amna-syeda-064191146/"><img src="./css/linkedin.png" alt="LinkedIn" className="icon"/></a>
    </footer>
    )
};

export default Footer;
